def compare_records(msg1: str, msg2: str):
    # 1. Split off headers
    h1 = msg1.split('@|@')
    h2 = msg2.split('@|@')
    vals1 = '@|@'.join(h1[len(header_fields):])
    vals2 = '@|@'.join(h2[len(header_fields):])
    # 2. Split payloads
    v1 = vals1.split('~|~')
    v2 = vals2.split('~|~')
    # 3. Find differences
    diffs = []
    for idx, (a, b) in enumerate(zip(v1, v2)):
        if a != b:
            diffs.append((value_fields[idx], a, b))
    return diffs
    

