    def compare_and_assert(self, input_hex, expected):
        output = translate(input_hex)
        diffs = compare_records(expected, output)
        for field, val1, val2 in diffs:
            print(f"{field}: '{val1}' â‰  '{val2}'")
        self.assertEqual(expected, output)

